import React from 'react';
import '../styles/headerStyles.css';

const Header = () => {
    return (
        <>
            <h2 id='header'>Patrick McGuigan</h2>
            <h5 id='subhead'>Full Stack Software Engineer</h5>
            <hr />
        </>
    );
};

export default Header;
